import React from "react";

import styles from "./CartItem.module.css"

const CartItem = (props) => {

    return (
        <div className={`${styles.menuItemContainer} ${styles.zebra}`}>

            <li key={props.item.id}>

                <h5 className={styles.mealName}>{props.item.name}</h5>
                <span className={styles.mealPrice}>${props.item.price.toFixed(2)} </span>
                <span>x{props.item.amount}</span>
            </li>

            <div>

            </div>
        </div>
    );

}

export default CartItem;
